<div class=""container"">

    <h5 class=""con""><bdi>من نحن؟</bdi></h5>
    <div class=""words"">
        <p>
            <bdi>
                يعد معمل زاج لونيا من أكبر معامل  الاختبارات المعملية الطبية الخاصة في الشرق الأوسط بما يوفره من خدمات المختبرات التشخيصية، والاختبارات الباثولوجية والإكلينيكية للمجتمعات الطبية في مصر حيث تمتلك الشركة حافظة أعمال تضم أكثر من 1,200 تحليل إكلينيكي في مجالات علوم المناعة وأمراض الدم/التخثر والكيمياء السريرية والطفيليات والأحياء المجهرية/الأمراض المعدية، والسموم والخلايا والأمراض الجراحية والتدفق الخلوي والبيولوجيا الجزيئية وعلم الوراثة الخلوية. ففي قسم التحليل الإكلينيكي، يتم جمع العينات في أكثر من 120 فرع تغطي المحافظات في جميع المناطق بمصر حيث يتم تحليلها في 6 معامل مركزية في المحافظات الرئيسية بالجمهورية.

            </bdi>
        </p>
        <p>
