            WriteLiteral(@"اسل المعامل الطبية الخاصة احتراما في مصر.

                واستطعنا، على مدى ثلاثون عاما من الخبرة والريادة في مجال الاختبارات الطبية، اكتساب الكثير من المعرفة عن احتياجاتك وتوقعاتك التي تعد السبب الرئيسي وراء سعينا الدائم للتحديث في جميع المجالات حتى أصبحنا أول معمل ينال اعتماد كلية علم الأمراض الأمريكية (CAP) في مصر عام 2010، وهو ما يعد المعيار الذهبي لاعتماد المعامل الطبية الأمر الذي يعني أنك ستضمن الحصول على نتائج معملية دقيقة، تطابق نفس النتيجة التي ستحصل عليها في أي معمل من المعامل الرائدة المعتمدة من كلية علم الأمراض الأمريكية (CAP) حول العالم.

                والآن نحن نمتلك أكبر شبكة في مصر تتكون من أكثر من 120 فرع على امتداد الجمهورية، ونهتم اهتماما كبيرًا باختيار أفضل العناصر البشرية للعمل في المختبر، سواء كان ذلك على المستوى الإداري أو التقني، حيث يعمل لدينا الآن أكثر من 1.500 موظف، بما في ذلك 200 أستاذ وطبيب من أكفأ الأساتذة والأطباء المتميزين في كل فرع كي يقدم لك الرعاية المتخصصة ويرد على استفساراتك.
